import React from "react";
import styled from "styled-components";

const Section = styled.section`
  width: 100vw;
  height: 100vh;
  position: fixed;
`;

const PrivacyPolicy = () => {
  return (
    <Section>
      <div>PrivacyPolicy</div>
    </Section>
  );
};

export default PrivacyPolicy;
